script: |
  super -f text -I q5919.spq | sort > q5919.out

inputs:
  - name: q5919.spq
    data: |
      SELECT - - col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col0 / + + col2 + + col2 NOT BETWEEN NULL AND + col2 * col2 + col2 + + - col2;
  - name: tab1

outputs:
  - name: q5919.out
    data: |
